    var getPricesFromCSV = true;
    var label_ADD_TO_CART = 'Kosárba';

    let products = [];
    let cardsHtml = [];
    $(document).ready(function () {
        if (new Date() <= pcEndDate && new Date() >= pcStartDate) {
            $.ajax({
                type: "GET",
                url: pcCsv_url,
                dataType: "text",
                success: function (data) {
                    processCarouselData(data);
                }
            });
        }
    });
    function processCarouselData(data) {
        var lines = data.split(/\r\n|\n/);
        var headings = lines[0].split(pcCsv__split_character);
        for (var j = 1; j < lines.length; j++) {
            var values = lines[j].split(pcCsv__split_character);
            if (values[0] != '') {
                // trim values
                for (let z = 0; z < values.length; z++) {
                    values[z] = values[z].trim();
                }
                var type = '';
                if (values[0] == "p") {
                    type = 'product';
                }
                else if (values[0] == 'm') {
                    type = 'model';
                }
                else if (values[0] == 'a') {
                    type = 'ad';
                }
                else {
                    continue;
                }
                var ves = '';
                if (type == 'product') {
                    ves = '';
                }
                var link = '';
                if (type == 'product') {
                    link = 'https://' + shopURL + '/-/' + values[1] + '.sku/' + lang + '/' + lang_uppercase + '/' + currency + '/';
                } else if (type == 'model') {
                    link = '/-/-/' + values[1] + '.cyid/' + siteID + '.cgid/' + lang + '/' + lang_uppercase + '/' + currency + '/';
                }
                let price = values[6];
                let priceQuantity = values[5];
                if (type == 'ad') {
                    continue;
                    products.push({
                        'type': type, 'sku': values[1].trim().replace(/ /g, '_'), 'productName': values[2], 'description': values[3], 'link': link, 'image': values[4], 've': '', 'priceQuantity': [priceQuantity], 'price': [{ quant: price, price: price }], 'priceStrike': values[7], 'discount': values[8],
                        'sticker': values[9], 'topText': values[10], 'video': values[11], 'category': values[12], 'banerImage': values[13], 'banerLink': values[14], 'popularity': values[15]
                    });
                }
                else {
                    products.push({
                        'type': type, 'sku': values[1].trim().replace(/ /g, '_'), 'productName': values[2], 'description': values[3], 'link': link, 'image': values[4], 've': '', 'priceQuantity': [priceQuantity], 'price': [{ quant: price, price: price }], 'priceStrike': values[7], 'discount': values[8],
                        'sticker': values[9], 'topText': values[10], 'video': values[11], 'category': values[12], 'banerImage': values[13], 'banerLink': values[14], 'popularity': values[15]
                    });
                }
            }
        }
        products.sort(function (a, b) {
            return b.popularity - a.popularity;
        });
        generateCarouselHTML();
    }
    function generateCarouselHTML() {
        for (let i = 0; i < products.length; i++) {
            cardsHtml.push(generateCardHtml(products[i]));
        }
        let html = '<div id="productsShowcase" class="carousel slide" data-ride="carousel">' +
            '<div class="carousel-inner" role="listbox">';
        for (let i = 0; i < cardsHtml.length; i++) {
            if ((i % 4 === 0 && i + 3 >= cardsHtml.length) || (i % 4 === 1 && i + 2 >= cardsHtml.length) || (i % 4 === 2 && i + 1 >= cardsHtml.length)) {
                break;
            }
            if (i === 0) {
                html += '<div class="carousel-item active"><div class="row">';
            }
            else if (i % 4 === 0) {
                html += '<div class="carousel-item"><div class="row">';
            }
            html += ' <div class="col-3">';
            html += cardsHtml[i];
            html += '</div>';
            if (i % 4 === 3 || i + 1 === cardsHtml.length) {
                html += '</div></div>';
            }
        }

        html += '</div>' +
            '<a class="carousel-control-prev" href="#productsShowcase" role="button" data-slide="prev">' +
