            if (items[i].find('.card-title').outerHeight() > maxTitleHeight) {
                maxTitleHeight = items[i].find('.card-title').outerHeight();
            }
            if (items[i].find('.product-description').outerHeight() > maxDescHeight) {
                maxDescHeight = items[i].find('.product-description').outerHeight();
            }
            if (items[i].find('.no-price-tag').length === 0) {
                entireRowWithoutPrice = false;
            }
        }
        for (let i = 0; i < items.length; i++) {
            items[i].find('.card-title').css('min-height', maxTitleHeight);
            items[i].find('.product-description').css('min-height', maxDescHeight);
            if (entireRowWithoutPrice === true) {
                items[i].find('.no-price-tag').css('margin-top', '12px');
                items[i].find('.product-category').css('margin-top', '0px');
            }
            else {
                items[i].find('.no-price-tag').css('margin-top', '27.5px');
                if (items[i].find('.no-price-tag').length !== 0 && items[i].find('.art-number').length === 0) {
                    items[i].find('.product-category').css('margin-top', '53px');
                }
            }
        }
    }
    function addToCartList(product, quantity, packingUnit, cn) {
        var supplierId = 'WuerthGroup-Wuerth';
        if (quantity == 0) {
            quantity = 1;
        }
        var sendData = 'ShoppingCartForm={"supplierId":"' + supplierId + '","articles":[{"productNo":"' + product.replace(/_/g, ' ') + '","packingUnit":"' + packingUnit + '","quantity":"' + quantity + '"}],"campaignName":"' + cn + '"}';
        var url = '/is-bin/INTERSHOP.enfinity/WFS/' + siteID + '-B1-Site/' + lang + '_' + lang_uppercase + '/-/' + currency + '/ViewModelDetail-AjaxAddArticlesToCurrentShoppingCart';
        $.ajax({
            method: "POST",
            url: url,
            success: function (msg) {
                $('#notifications').html(msg);
                $('#notifications > div').slideDown("slow");
                setTimeout(function () { $('#notifications > div').slideUp("slow"); }, 3000);
                $('#miniBasketCounter').text(jsonResponse.shoppingCartItemsCount);
            }, data: sendData
        });
    }
